	public List<Object> getBRF16_1Archival() {
		try {
			List<Object> merged = new ArrayList<>();
			merged.addAll(BRF16_1_Archival_Summary_Repo_1.getBRF16_1archival());
			merged.addAll(BRF16_1_Archival_Summary_Repo_2.getBRF16_2archival());
			merged.addAll(BRF16_1_Archival_Summary_Repo_3.getBRF16_3archival());
			merged.addAll(BRF16_1_Archival_Summary_Repo_4.getBRF16_4archival());
			merged.addAll(BRF16_1_Archival_Summary_Repo_5.getBRF16_5archival());
			merged.addAll(BRF16_1_Archival_Summary_Repo_6.getBRF16_6archival());

			Set<String> seen = new HashSet<>();
			List<Object> uniqueList = new ArrayList<>();

			for (Object obj : merged) {
				Object[] row = (Object[]) obj;
				String key = row[0] + "_" + row[1]; // unique by date+version
				if (seen.add(key)) {
					uniqueList.add(row);
				}
			}

			System.out.println("Unique Count: " + uniqueList.size());
			return uniqueList;

		} catch (Exception e) {
			System.err.println("Error fetching BRF1_2 Archival data: " + e.getMessage());
			e.printStackTrace();
			return Collections.emptyList();
		}
	}

